import ReactDom from 'react-dom';
import './index.css';

function BookList(){
  return(
    <section className="bookList">
      <div>
        <Book/>
        <Book/>
        <Book/>
      </div>
    </section>
  )
}

const Book = () =>{
  return (
    <article>
      <Image/>
      <Author/>
      <Title/>
    </article>
  )
}

const Title = () => <h1> Ikigai </h1>;

const Image = () => {
  return (
    <img src="https://images-na.ssl-images-amazon.com/images/I/51T8OXMiB5L._SX356_BO1,204,203,200_.jpg" title="" />
  )
}

const Author = () =>{
  return (
    <h4 style={{color:'#000',fontSize:'10px'}}>Héctor García</h4>
  )
}

